## Builded with AIO
## aio -m onboard -release pango libcairo2 -exclude dconf-settings dconf-gsettings-backend -storename Onboard -icon https://raw.githubusercontent.com/PapirusDevelopmentTeam/papirus-icon-theme/master/Papirus/64x64/apps/onboard.svg -background https://cdn.hipwallpaper.com/i/19/65/MBj4Hz.jpg
app: onboard
binpatch: true
#getonly: #true or false

ingredients:
  dist: jammy
  packages:
    - onboard
  exclude:
    - dconf-settings
    - dconf-gsettings-backend
  release:
    - pango
    - libcairo2
  sources:
    - deb http://archive.ubuntu.com/ubuntu jammy main universe multiverse
    - deb http://security.ubuntu.com/ubuntu jammy-security main universe multiverse
    - deb http://archive.ubuntu.com/ubuntu jammy-updates main restricted universe multiverse
#  script:
#    - Preparação dos ingredientes
store:
  name: Onboard
  icon:  svg
  background:  jpg
